import AvatarImg from '../../images/person-male.png'
import './Icon.css'
import Header from '../Header'

class Icon extends React.Component{

    render(){
        return (
            <img src={AvatarImg} style={{width:'50px', position:'absolute', right:'0%'}}/>

        )
    }

}

export default Icon
